const Settings = () => {
    return (
        <Container>
            <Row>
                <Col md={4}>md=4</Col>
                <Col md={{ span: 4, offset: 4 }}>{`md={{ span: 4, offset: 4 }}`}</Col>
            </Row>
        </Container>
    );
}

export default Settings;
